import './App.css';
import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import News from './components/News';

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <Routes>
            <Route expath="/" element={<News pageSize={9} country="in" category="general" />} />
            <Route exact path="/Business" element={<News pageSize={9} country="in" category="Business" />} />
            <Route act path="/Entertainment" element={<News pageSize={9} country="in" category="Entertainment" />} />
            <Route actpath="/General" element={<News pageSize={9} country="in" category="General" />} />
            <Route actpath="/Health" element={<News pageSize={9} country="in" category="Health" />} />
            <Route actpath="/Science" element={<News pageSize={9} country="in" category="Science" />} />
            <Route actpath="/Sports" element={<News pageSize={9} country="in" category="Sports" />} />
            <Route actpath="/Technology" element={<News pageSize={9} country="in" category="Technology" />} />
          </Routes>act
        </Router>
      </div>
    );
  }
}
